import React from 'react'
import TransactionItem from './TransactionItem';

const TransactionItems = (props) => {
  return (
    <tbody>
      {/* <li>AAA</li> */}
      {/* {props.transactionStore.state.list.map((transaction, i) => (
        <TransactionItem
          idx={i}
          id={transaction.id}
          date={transaction.date}
          transactionStore={props.transactionStore}  
        />
      ))}  */}

      {props.productStore.state.productsFiltered.map((product, i) =>  (
        <TransactionItem
          idx={i}
          id={product.title}
          date={product.harga}
          transactionStore={props.productStore}  
        />
      ))} 

    </tbody>
  )
}

export default TransactionItems
